import React from 'react';
import PropTypes from 'prop-types';
import Link from 'next/link';
import { Menu} from 'antd';
import Logo from '../pages/public/images/PocketVaccineLogo.png';

const AppLayout = ({ children }) => {
    return(
        <div>
            <div style={{textAlign:'center'}}>
                <img src={Logo} alt="logo" width="400px" height="60" style={{padding:'20px 0 0 30px'}}/>
            </div>
            <div style={{textAlign:'center'}}>
                <Menu mode="horizontal" style={{display:'inline-block', fontSize:'medium'}}>
                    <Menu.Item >
                        <Link href="/"><a>    커 뮤 니 티    </a></Link>
                    </Menu.Item>
                    <Menu.Item>
                        <Link href="/vaccinegraph"><a>    살 펴 보 기    </a></Link>
                    </Menu.Item>
                    <Menu.Item>
                        <Link href="/vaccinestatus"><a>    접 종 현 황    </a></Link>
                    </Menu.Item>
                    <Menu.Item>
                        <Link href="/mypage"><a>    마 이    </a></Link>
                    </Menu.Item>
                </Menu>
            </div>
                <div style={{textAlign:'center', margin:'20px 10px 0 0'}}>
                    {children}
                </div>
            </div>
    );
}

AppLayout.proTypes = {
    children : PropTypes.node.isRequired,
}

export default AppLayout;
